import React from "react";
import { Dropdown, Item, Label } from "semantic-ui-react";
const items = [
  "My Profile",
  "Configuration Notification",
  "Extensions",
  "Log out",
];
const Profile = () => (
  <Dropdown
    style={{ marginRight: "20px" }}
    icon={
        <Label as='a' image>
        <img src='https://react.semantic-ui.com/images/avatar/small/joe.jpg' />
        Joe
      </Label>
    }
    text="Paul Walker"
  >
    <Dropdown.Menu>
      {items.map((item, id) => (
        <Dropdown.Item key={item + id}>{item}</Dropdown.Item>
      ))}
    </Dropdown.Menu>
  </Dropdown>
);

export default Profile;
